export var TerraNetwork;
(function (TerraNetwork) {
    TerraNetwork["Tequila"] = "tequila-0004";
    TerraNetwork["Columbus"] = "columbus-4";
})(TerraNetwork || (TerraNetwork = {}));
export const UNSUPPORTED_TERRA_NETWORK = `Terra is not supported by the current RenVM network.`;
export const transactionToDeposit = (transaction) => ({
    transaction,
    amount: transaction.amount,
});
